const addUser = (user) => {
    return {
        type: 'NEW_USER',
        payload: user
    }

}

const logout = () => {
    return {
        type: 'LOGOUT'
    }
}

const someErorr = (bool) => {
    return {
        type: 'ERROR',
        payload: bool
    }
}

const allUsers = (allUsers) => {
    return {
        type: 'ALL_USERS',
        payload: allUsers
    }
}

const posts = (posts) => {
    return {
        type: 'ALL_POSTS',
        payload: posts
    }
}

const setPost = (post) => {
    return {
        type: 'POST',
        payload: post
    }
}

const setPostUser = (user) => {
    return {
        type: 'POST_USER',
        payload: user
    }
}

export {
    addUser,
    logout,
    someErorr,
    allUsers,
    posts,
    setPost,
    setPostUser
}
